// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract PaperMastersNFI is ERC721, Ownable  {

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIndexCounter;

    struct identity
    {
        string name;
        string email;
        string profession;
        string organization;
        string slogan;
        string website;
        string uniqueYou;
        string backGroundRGB;
        uint originDate;
        string compiledAvatarSVG;
    }

    mapping(address => identity) public _ownerNFI;

    constructor() ERC721("PaperMastersNFI", "NFI") {}


    function addressToIdentity(address walletAddress) public view returns(identity memory ident) {
        ident = _ownerNFI[walletAddress];
    }


    function _baseURI() internal pure override returns (string memory) {
        return "www.papermasters.io/identity/";
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        address owner = ownerOf(tokenId);

        string memory baseURI = _baseURI();

        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, owner)) : "";
    }

    event Log(uint gas);

    // Fallback function must be declared as external.
    fallback() external payable {
        // send / transfer (forwards 2300 gas to this fallback function)
        // call (forwards all of the gas)
        emit Log(gasleft());
    }

    receive() external payable {}

    function deposit() public payable {}

    function getBalance() public view returns (uint) {
        return address(this).balance;
    }
    function withdraw() external onlyOwner{
        // This forwards all available gas. Be sure to check the return value!
        uint amount = address(this).balance;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed.");
    }


    // function sendViaCall(address payable _to) public payable {
    //     // Call returns a boolean value indicating success or failure.
    //     // This is the current recommended method to use.
    //     (bool sent, bytes memory data) = _to.call{value: msg.value}('');
    //     require(sent, "Failed to send Ether");
    // }



    function mintNFI (
        string memory name,
        string memory email,
        string memory profession,
        string memory organization,
        string memory slogan,
        string memory website,
        string memory uniqueYou,
        string memory backGroundRGB,
        uint originDate,
        string memory compiledAvatarSVG
    ) public payable {
        _ownerNFI[msg.sender] = identity(
            name,
            email,
            profession,
            organization,
            slogan,
            website,
            uniqueYou,
            backGroundRGB,
            originDate,
            compiledAvatarSVG
        );

        _safeMint(msg.sender, _tokenIndexCounter.current());

        emit NFIMinted(msg.sender, _tokenIndexCounter.current());

        _tokenIndexCounter.increment;

    }

    event NFIMinted(address indexed _from, uint256 tokenId);



    //disable so no transfer
    // setApprovalForAll(operator, approved)
    // isApprovedForAll(owner, operator)
    // transferFrom(from, to, tokenId)
    // safeTransferFrom(from, to, tokenId)
    // safeTransferFrom(from, to, tokenId, _data)
    // _safeTransfer(from, to, tokenId, _data)
}
